import React from 'react';

const Contact = () => {
    return (
        <div>
            <h4>Contact Information</h4>
            <p>Call us: 8801234-578910</p>
            <p><a href="https://www.iutcs.org"></a></p>
        </div>
    );
};

export default Contact;
